import './media.css';
import './Cart.css';

function Cart() {
    return (
        <div className="cart">
            <div className="container">
                <h3 className="cart-title">Корзина</h3>
                <div className="cart-list"></div>
                <div className="cart-alert">Внимание, минимальная сумма заказа для доставки 15 руб.<br></br>Чтобы добавить позицию в заказ <a href="#">вернитесь в меню</a></div>
                <div className="cart-cost"></div>
                <div className="cart-btn">
                    <button className="return-btn"><a href="#">Вернуться в меню</a></button>
                    <button className="order-btn"><a href="#">Заказать</a></button>
                </div>
            </div>
        </div>
    )
};

export default Cart;
